import React from 'react';
import './quizcard.css';
import QuizSettings from './QuizSettings/QuizSettings.js';
import AnswerButtons from './AnswerButtons/AnswerButtons.js';
import NextButton from './NextButton/NextButton.js';

class QuizCard extends React.Component {
  constructor(props) {
    super(props);
    
    this.state = {
      category: 'animals',
      words: 'learning'
    }
  }

  changeCategory = (cat) => {
    this.setState({
      category: cat
    });
  }
 

  render () {
    return (
    <div className="centered" id="main-Container">
        <div className="half purple">
          <QuizSettings />
        </div>
        <div className="other-half">
          <div id="questionWrapper">
            <h4>1. Question here lalal what is neko??</h4>
            <AnswerButtons />
          </div>
          <div id="nextWrapper">
            <NextButton />
          </div>
        </div>
      </div>
    );
  }
}

export default QuizCard;
